import React from 'react';
import { FaHome, FaEraser } from 'react-icons/fa'
import { GrStatusInfo, GrDown, GrInProgress, GrUp } from "react-icons/gr";
import { MdUpdate, MdOutlineThumbUp } from "react-icons/md";

const SidebarData = () => {
    const sideBaritems = [
        {
            path: "/",
            name: "Home",
            icon: <FaHome />
        },
        {
            path: "/ProjectStatus",
            name: "ProjectStatus",
            icon: <GrStatusInfo />,
            iconClosed: <GrDown />,
            iconOpened: <GrUp />,

            dropDown: [
                {
                    path: "/ProjectStatus/Completed",
                    name: "Completed",
                    icon: <MdOutlineThumbUp />

                },
                {
                    path: "/ProjectStatus/OnProcess",
                    name: "OnProcess",
                    icon: <GrInProgress />
                },
            ]
        },
        {
            path: "/UpdateEmployee",
            name: "UpdateEmployee",
            icon: <MdUpdate />

        },
        {
            path: "/RemoveEmployee",
            name: "RemoveEmployee",
            icon: <FaEraser />
        }
    ]

}

export default SidebarData;
